import React, { Component,ListGroup, } from "react";
import { Col } from "react-bootstrap";
export default class Hasil extends Component {
  render() {

     
    return (
      <div>
        <Col md="2" mt="2">
          <h4>
              
            <ListGroup>
                {this.props.keranjang.map((data)=>
                 <ListGroup.Item>{data}</ListGroup.Item>
                )}
            </ListGroup>
          </h4>

          <hr />
        </Col>
      </div>
    );
  }
}
